import React from 'react'

const axios = require('axios')

function Users() {
    var arr = []
    
    /*var getUser = () => {
        axios.get('http://localhost:5000/api/dummy')
        .then( function(response) {
            console.log(response)
           arr = response.data;

           for(const ele of arr) {
               console.log(ele.Name + " " + ele.ID  + " " + ele.Address)
           }
        })
        .catch(function (error) {
            console.log(error);
          })
    }*/

    return <>
    {
        axios.get('http://localhost:5000/api/dummy')
        .then( function(response) {
            console.log(response)
           arr = response.data;

           for(const ele of arr) {
               console.log(ele.Name + " " + ele.ID  + " " + ele.Address)
           }
        })
        .catch(function (error) {
            console.log(error);
          })
    }
    <ol>
      {arr.map(ele => (
        <li key={ele}>{ele}</li>
      ))}
    </ol>
   
    </>
}

export default Users
